	int[][] dirs = {{1,0},{0,1},{-1,0},{0,-1}};
	public int maximumMinimumPath(int[][] A) {
		if(A ==null) return -1;
		int res=A[0][0];
		int r =A.length;
		int c = A[0].length;
		
		boolean[][] visited = new boolean[r][c];
		visited[0][0]=true;
		PriorityQueue<int []> pq = new PriorityQueue<>((a,b) ->b[2]-a[2]);
		pq.add(new int[] {0,0,A[0][0]});
		while(pq.size() !=0){
			int[] cur =pq.poll();
			visited[cur[0]][cur[1]]=true;
			res = Math.min(res, cur[2]);
			if(cur[0] ==r-1 && cur[1] == c-1) {
				return res;
			}
			for(int[] dir : dirs)
			{
				int x = dir[0]+cur[0];
				int y = dir[1]+cur[1];
				if(x>r-1 || y>c-1 || x<0|| y<0 || visited[x][y]) {
					continue;
				}
				//visited[x][y] =true;
				pq.add(new int[] {x,y,A[x][y]});
			}
		}
		return res;
		
	}
